import React from 'react';
Link

const Navbar = () => {
	return (
		<nav>
			<ul>
				<li>
					<a href="./">Home</a>
				</li>
				<li><a href="./about">About</a></li>
				<li>
					<a href="./login">Login</a>
				</li>
			</ul>
		</nav>
	);
}

export default Navbar;
